export default function Todo(props) {
    return (
                <div className="todo-item"> 
                <div className="todo-outer-circle" onClick={ () => completeTodo(index)} >
                  <div className={todo.isCompleted ? "todo-circle-ticked" : "todo-inner-circle"}>
                  </div>
                </div>
                <div style={{ textDecoration: todo.isCompleted ? "line-through" : "" }} className="todo-text">
                  {todo.text}</div>
                <button onClick={ () => removeTodo(index)} className="todo-delete"></button>
              </div>

    );
}
